class Solution(object):
    def maxProduct(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        if not nums:
            return None
        res_list = []
        for i in range(len(nums)):
            res = [nums[i]]
            if i != 0:
                last = i-1
                for j in res_list[last]:
                    res.append(j*nums[i])
                res_list[last] = max(res_list[last])
            max_res = max(res)
            min_res = min(res)
            res_list.append([max_res,min_res])
        res_list[-1] = max(res_list[-1])
        return max(res_list)

